import React, { Component } from "react";

class Voter extends Component {
  render() {
    const { votes } = this.props;
    return (
      <div>
        <button onClick ={this.handleClick}>
          <span>Upvote △</span>
        </button>
        <button>
          <span>Downvote ▽</span>
        </button>
      </div>
    );
  }
}

export default Voter;
